import React, { useState } from 'react';
import PropTypes from 'prop-types';



const Count = props => (
	<Panel id={props.id}>
		<PanelHeader
			left={<PanelHeaderBack onClick={props.go} data-to="home"/>}
		>
			Count
		</PanelHeader>
	</Panel>
);

Count.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
};

export default Count;
